column17:
Requerimiento Logístico Nro.006; solicitado por la Secretaría de
Gobierno y Participación Ciudadana como supervisor; en aras
de garantizar el apoyo logístico a jornada de conciliación;
deportistas que participarán en los juegos departamentales;
jornada de apoyo a la discapacidad; entre otras.

